--
-- Name: check_room_can_deactivate(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_room_can_deactivate() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NEW.is_active = false AND OLD.is_active = true THEN
        IF EXISTS (
            SELECT 1 FROM game_rounds 
            WHERE room_id = NEW.id 
            AND completed_at IS NULL 
            AND archived_at IS NULL
        ) THEN
            RAISE EXCEPTION 'Cannot deactivate room with active games';
        END IF;
    END IF;
    RETURN NEW;
END;
$$;


--
-- Name: log_seed_usage(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.log_seed_usage() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Log seed generation
    IF TG_OP = 'INSERT' THEN
        RAISE LOG 'SEED_AUDIT: New round created - Room: %, Round: %, Server Seed: %, Timestamp: %', 
                  NEW.room_id, NEW.id, NEW.server_seed, NEW.created_at;
        RETURN NEW;
    END IF;
    
    -- Log seed completion/archival
    IF TG_OP = 'UPDATE' THEN
        IF OLD.completed_at IS NULL AND NEW.completed_at IS NOT NULL THEN
            RAISE LOG 'SEED_AUDIT: Round completed - Room: %, Round: %, Server Seed: %, Winner: %, Completed: %',
                      NEW.room_id, NEW.id, NEW.server_seed, NEW.winner_id, NEW.completed_at;
        END IF;
        
        IF OLD.archived_at IS NULL AND NEW.archived_at IS NOT NULL THEN
            RAISE LOG 'SEED_AUDIT: Round archived - Room: %, Round: %, Server Seed: %, Archived: %',
                      NEW.room_id, NEW.id, NEW.server_seed, NEW.archived_at;
        END IF;
        
        RETURN NEW;
    END IF;
    
    RETURN NULL;
END;
$$;


