-- Name: validate_server_seed(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.validate_server_seed(seed text) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- Check if seed is exactly 64 characters and contains only hex characters
    RETURN seed ~ '^[0-9a-fA-F]{64}$';
END;
$_$;


